package com.jeedev.msdp.sys.client.entity;import javax.persistence.Column;import javax.persistence.Entity;import javax.persistence.SequenceGenerator;import javax.persistence.Table;import com.jeedev.msdp.core.data.BaseEntity;/** * @类名称 SysClntendEntity.java * @类描述 <pre>客户端信息表实体</pre> * @作者 Colin.DZX Colin.DZX@tansun.com.cn * @创建时间 2017年8月22日 下午12:27:35 * @版本 1.00 * @修改记录 * <pre> *     版本                       修改人 		修改日期 		 修改内容描述 *     ---------------------------------------------- *     1.00 	Colin.DZX 	2017年8月22日              *     ---------------------------------------------- * </pre> */@Entity@Table(name = "SYS_CLNTEND")@SequenceGenerator(name="seq",allocationSize=1,initialValue=1,sequenceName="SEQ_SYS_USER_DEPT_REL")public class SysClntendEntity extends BaseEntity<Integer> {	/**	 * 	 */	private static final long serialVersionUID = 1L;	/** 客户端编号 **/	@Column(name="CLNTEND_ID")	private String clntendId;	/** 客户端名称 **/	@Column(name="CLNTEND_NM")	private String clntendNm;	/** 客户端安全码 **/	@Column(name="CLNTEND_SECRET")	private String clntendSecret;	/** 客户端域名 **/	@Column(name="CLNTEND_DOMAIN")	private String clntendDomain;	/** 客户端状态(1:启用，2:禁用) **/	@Column(name="CLNTEND_ST")	private String clntendSt;		public String getClntendId() {		return clntendId;	}	public void setClntendId(String clntendId) {		this.clntendId = clntendId;	}	public String getClntendNm() {		return clntendNm;	}	public void setClntendNm(String clntendNm) {		this.clntendNm = clntendNm;	}	public String getClntendSecret() {		return clntendSecret;	}	public void setClntendSecret(String clntendSecret) {		this.clntendSecret = clntendSecret;	}	public String getClntendDomain() {		return clntendDomain;	}	public void setClntendDomain(String clntendDomain) {		this.clntendDomain = clntendDomain;	}	public String getClntendSt() {		return clntendSt;	}	public void setClntendSt(String clntendSt) {		this.clntendSt = clntendSt;	}}